import classes from "./History.module.css";
import { convert } from "../CartPage/ProductList";
import { Link } from "react-router-dom";
import { json, useLoaderData } from "react-router-dom";
//----------------------------------------------------------
function History() {
  const data = useLoaderData();
  const list = data.list;
  const total = list.reduce(
    (total, cur) => total + cur.product_id.price * cur.quantity,
    0
  );
  return (
    <div className={classes.container}>
      <table cellSpacing={0}>
        <thead>
          <tr>
            <th>ID ORDER</th>
            <th>ID USER</th>
            <th>NAME</th>
            <th>PHONE</th>
            <th>ADDRESS</th>
            <th>TOTAL</th>
            <th>STATUS</th>
            <th>DETAIL</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>January</td>
            <td>$100</td>
            <td>January</td>
            <td>$100</td>
            <td>January</td>
            <td>$100</td>
            <td>January</td>
            <td>$100</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
//---------------------------------------------------
export default History;
export async function loader() {
  const response = await fetch("http://localhost:5000/get-cart", {
    method: "GET",
    credentials: "include",
  });
  if (!response.ok) {
    throw json(
      { message: "Can not fecth detail event" },
      {
        status: 550,
      }
    );
  }
  const data = await response.json();
  return data;
}
